import styled from "styled-components";

export const StyledHeader = styled.header`
  display: flex;
  justify-content: space-between;
  width: 100%;
  padding: 1rem;
  border-bottom: 1px solid rgba(150, 150, 150, 0.235);
  h1 {
    font-size: 1.5rem;
  }

  a {
    cursor: pointer;
  }
`;
